import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card } from 'react-bootstrap';

const Dashboard = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('http://127.0.0.1:8000/analytics/');
      setData(result.data);
    };
    fetchData();
  }, []);

  return (
    <Container className="mt-5">
      <Row>
        <Col>
          <Card>
            <Card.Body>
              <Card.Title>Total Emergencies</Card.Title>
              <Card.Text>{data.totalEmergencies}</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col>
          <Card>
            <Card.Body>
              <Card.Title>Total Users</Card.Title>
              <Card.Text>{data.totalUsers}</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        {/* Add more analytics cards as needed */}
      </Row>
    </Container>
  );
};

export default Dashboard;
